	@Override
	public PluginEntity getPluginEntity(Class<?> beanClass) {
		String entityId = beanClass.getSimpleName();
		if (entityId.endsWith("Type"))
			entityId = entityId.substring(0, entityId.length() - 4);
		else if (entityId.endsWith("Wrapper"))
			entityId = entityId.substring(0, entityId.length() - 7);
		return pluginEntityURIMap.get("adi://org.adichatz.studio/model/".concat(entityId).concat("MM"));
	}
